import './Info.css';
import Person from './pexels-daniel-xavier-1239291.jpg';
import GitHubIcon from '@mui/icons-material/GitHub';

class Info extends Component {
    render() {
        return (
            <div className={'container'}>
                <div className={'info-main'}>
                    <div className={'left'}>
                        <div className={'top'}>
                            <img src={Person}/>
                        </div>
                        <div className={'bot'}>
<div className={'cube'}>
    <img src={GitHubIcon}/>
</div>
                        </div>
                    </div>
                </div>
            </div>

        );
    }
}

export default Info;
